import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import './Home.css';

const Home = () => {
  // Налаштування для великого слайдера
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 5,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
    arrows: true,
    responsive: [
      {
        breakpoint: 1200,
        settings: {
          slidesToShow: 4,
        }
      },
      {
        breakpoint: 992,
        settings: {
          slidesToShow: 3,
        }
      },
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 2,
        }
      },
      {
        breakpoint: 576,
        settings: {
          slidesToShow: 1,
        }
      }
    ]
  };

  // Великі тестові зображення
  const testImages = [
    { id: 1, src: "https://picsum.photos/500/300?1", alt: "Фото 1" },
    { id: 2, src: "https://picsum.photos/500/300?2", alt: "Фото 2" },
    { id: 3, src: "https://picsum.photos/500/300?3", alt: "Фото 3" },
    { id: 4, src: "https://picsum.photos/500/300?4", alt: "Фото 4" },
    { id: 5, src: "https://picsum.photos/500/300?5", alt: "Фото 5" },
    { id: 6, src: "https://picsum.photos/500/300?6", alt: "Фото 6" },
    { id: 7, src: "https://picsum.photos/500/300?7", alt: "Фото 7" },
    { id: 8, src: "https://picsum.photos/500/300?8", alt: "Фото 8" },
    { id: 9, src: "https://picsum.photos/500/300?9", alt: "Фото 9" },
    { id: 10, src: "https://picsum.photos/00/300?10", alt: "Фото 10" }
  ];

  return (
    <div className="home-page">
      <section className="about">
        <div className="container">
          <div className="about-content">
            <img src="/img/about.jpg" alt="Про школу" />
            <div className="about-text">
              <h2>Ласкаво просимо до школи мистецтв «Антарес»</h2>
              <p>
                Наша школа - це сучасний освітній простір, де діти розкривають 
                свої творчі здібності та опановують різні види мистецтва.
              </p>
              <p>
                Ми пропонуємо навчання за різними напрямами: музика, образотворче 
                мистецтво, хореографія та театральне мистецтво.
              </p>
              <a href="/site/about" className="learn-more">Дізнатися більше</a>
            </div>
          </div>
        </div>
      </section>

      <section className="activities">
        <div className="container">
          <h2>Наші напрямки навчання</h2>
          <p>Виберіть напрямок, який вас цікавить</p>
          <div className="activity-list">
            <div className="activity">
              <img src="/img/music.jpg" alt="Музичний відділ" />
              <h3>Музичний відділ</h3>
              <a href="/site/departments">Детальніше</a>
            </div>
            <div className="activity">
              <img src="/img/art.jpg" alt="Художній відділ" />
              <h3>Художній відділ</h3>
              <a href="/site/departments">Детальніше</a>
            </div>
            <div className="activity">
              <img src="/img/dance.jpg" alt="Хореографія" />
              <h3>Хореографія</h3>
              <a href="/site/departments">Детальніше</a>
            </div>
          </div>
        </div>
      </section>

      <section className="gallery">
        <div className="container">
          <h2>Галерея</h2>
          <div className="large-slider-container">
            <Slider {...settings}>
              {testImages.map((image) => (
                <div key={image.id} className="slide-item">
                  <img 
                    src={image.src} 
                    alt={image.alt}
                    className="large-slide-image"
                  />
                </div>
              ))}
            </Slider>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
